import createLucideIcon from '../createLucideIcon';

const ArrowLeft = createLucideIcon('ArrowLeft', [
  ['line', { x1: '19', x2: '5', y1: '12', y2: '12', key: '9fu2vq' }],
  ['polyline', { points: '12 19 5 12 12 5', key: '1ksm0z' }],
]);

export default ArrowLeft;
